	eval("module.exports = \"\\n\\t<div class=\\\"buyWrap\\\" style=\\\"padding: 45px 0 0 0;\\\">\\n\\t\\t<div style=\\\"position: fixed; top: 0; left: 0; width: 100%; z-index: 10;\\\">\\n\\t\\t\\t<header id=\\\"bigCustomerHeader\\\">\\n\\t\\t\\t\\t<a class=\\\"back\\\" href=\\\"javascript:window.history.back();\\\"></a>\\n\\t\\t\\t\\t注册协议\\n\\t\\t\\t</header>\\n\\t\\t</div>\\n\\t\\t<div style=\\\"padding: 10px; background: #FFFFFF; font-size: 12px;\\\">\\n\\t\\t\\t<p>本协议是您与塑料圈（简称\\\"本站\\\"，网址：http://q.myplas.com）所有者上海中晨电子商务股份有限公司（以下简称为\\\"塑料圈\\\"）之间就塑料圈所提供的服务(下称“服务”)等相关事宜所订立的契约，请您仔细阅读本注册协议，您点击\\\"同意并继续\\\"按钮后，本协议即构成对双方有约束力的法律文件。</p>\\n\\t\\t\\t<p>1.用户服务条款的确认和接受</p> \\n\\t\\t\\t<p>1.1 以任何方式注册或登录塑料圈即表示您同意自己已经与塑料圈订立本协议，且您将受本协议的条款和条件(下称“条款”) 约束。用户确认：本协议条款是处理双方权利义务的契约，始终有效，法律另有强制性规定或双方另有特别约定的，依其规定。</p> \\n\\t\\t\\t<p>1.2 塑料圈可随时自行全权决定更改“条款”。如您不同意相关变更，必须停止使用“服务”。经修订的“条款”一经在塑料圈公布后，立即自动生效。</p>\\n\\t\\t\\t<p>1.3 您应在第一次登录后仔细阅读修订后的“条款”，并有权选择停止继续使用“服务”；一旦您继续使用“服务”，则表示您已接受经修订的“条款”，当您与塑料圈发生争议时，应以最新的服务协议为准。</p>\\n\\t\\t\\t<p>1.4 塑料圈保留在中华人民共和国大陆地区法施行之法律允许的范围内独自决定拒绝服务、关闭用户账户、清除或编辑内容或取消订单的权利。</p> \\n\\t\\t\\t<p>2.服务简介 用户注册后可以直接登录塑料圈查看塑料报价，塑料头条等服务信息。塑料圈会员实行免费会员制度,注册用户可免费使用塑料圈提供的功能和服务，注册会员对所提交的任何信息的真实性和合法性负责。</p>\\n\\t\\t\\t<p>3.用户使用规则</p>\\n\\t\\t\\t<p>3.1在登记过程中，您将使用手机号码作为会员注册名并自主创建密码。用户应本着个人或企业诚信向本站提供注册资料，用户同意其提供的注册资料真实、准确、完整、合法有效，用户注册资料如有变动的，应及时更新其注册资料。如果用户提供的注册资料不合法有效、不真实、不准确、不详尽的，用户需承担因此引起的相应责任及后果，并且塑料圈保留终止用户使用塑料圈各项服务的权利。</p>\\n\\t\\t\\t<p>3.2  会员注册时必须保证知悉本协议及其他已公开的所有文件规定的条款、条件，并承诺遵守该等条款、条件。</p>\\n\\t\\t\\t<p>3.3用户在本站进行浏览、发布报价、下单等活动时，未经用户许可塑料圈不会向任何第三方提供、公开或共享用户注册资料中的企业真实姓名/名称、个人有效身份证件号码、联系方式、营业执照等个人身份信息除非得到用户授权或法律另有规定。</p>\\n\\t\\t\\t<p>3.3您一旦注册成功成为用户，您的密码和账号将做为您的隐私，不对外透露。如果您未保管好自己的帐号和密码而对您损害，您将自行负责。您可随时修改您的密码，使用新密码登录。用户同意若发现任何非法使用用户帐号或安全漏洞的情况，立即举报给塑料圈。</p>\\n\\t\\t\\t<p>3.4用户同意，塑料圈拥有通过邮件、短信、电话等形式，向在本站注册、购物的用户发送订单信息、促销活动等告知信息的权利。</p>\\n\\t\\t\\t<p>4.会员资格的终止</p>\\n\\t\\t\\t<p>4.1 会员可以在任何时间停止使用本网站并向塑料圈申请终止其会员资格。</p>\\n\\t\\t\\t<p>4.2 会员同意，塑料圈根据本协议及相关规则的任何规定终止会员资格的措施可在不发出事先通知的情况下实施，会员资格终止后，会员的账号立即无效，塑料圈将撤销账号以及在账号内的所有相关资料和档案。会员资格终止后，塑料圈将没有义务为会员保留原账号及与之相关的任何信息。</p>\\n\\t\\t\\t<p>4.3 会员资格终止时，会员无条件同意以下规则： （1）全面适当履行所有未完成之交易； （2）全面适当履行与第三人在该会员资格终止或届满前有可能确认的交易； （3）与塑料圈结清所有款项；</p>\\n\\t\\t\\t<p>4.4会员有下列情形之一的，塑料圈有权终止会员资格，由此产生的一切法律上和经济上的责任由该会员承担： (a) 扰乱交易秩序或恶意损害其他会员利益的；  (b) 提供虚假资料或虚假信息的；  (c) 损害国家荣誉和利益的；  (d) 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的； (e) 破坏国家宗教政策，宣扬邪教和封建迷信的； (f) 散布谣言，扰乱社会秩序，破坏社会稳定的； (g) 散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的； (h) 侮辱或者诽谤他人，侵害他人合法权益的；  (i) 含有法律、行政法规禁止的其他内容的。</p>\\n\\t\\t\\t<p>5.商品信息 本站上的货物价格、数量、是否有货等商品信息将根据市场行情及销售情况随时发生变动，本站不作特别通知。由于网站货物信息数量庞大，虽然本站会尽最大努力保证您所浏览商品信息的准确性，但由于网络及电脑终端兼容性等客观原因存在，本站网页显示的信息可能会有一定的滞后性或差错，对此情形请您知悉并理解；塑料圈欢迎纠错，并会视情况给予纠错者一定的奖励。</p>\\n\\t\\t\\t<p>6.您授予本公司的许可使用权       您授予本公司独家的、全球通用的、永久的、免费的许可使用权利 (并有权在多个层面对该权利进行再授权)，使本公司有权(全部或部份地) 使用、复制、修订、改写、发布、翻译、分发、执行和展示\\\"您的资料\\\"或制作其派生作品，和/或以现在已知或日后开发的任何形式、媒体或技术，将\\\"您的资料\\\"纳入其他作品内，塑料圈可能与第三方合作向用户提供相关的网络服务，在此情况下，如该第三方同意承担与塑料圈同等的保护用户隐私的责任，则塑料圈有权将“您的资料”提供给该第三方。塑料圈将仅根据本公司的隐私声明使用“您的资料”。本公司隐私声明的全部条款属于本协议的一部份，因此，您必须仔细阅读。请注意，您一旦自愿地在塑料圈交易地点披露“您的资料”，该等资料即可能被其他人士获取和使用。</p>\\n\\t\\t\\t<p>7.服务说明</p>\\n\\t\\t\\t<p>7.1 塑料圈为会员提供信息收集、交流以及塑料圈公布的各类规则所规定的各类网上交易和服务。</p>\\n\\t\\t\\t<p>7.2 塑料圈不承担因会员提供的任何信息而产生的任何责任，也不承担会员与其它会员之间因网上或线下交易而产生的本协议或各类规则规定之外的其他责任。</p>\\n\\t\\t\\t<p>7.3 会员同意，塑料圈有权独立判断会员的行为是否符合本协议及相关规则的要求。塑料圈可随时中断对违反本协议及相关规则内容的会员的服务。</p>\\n\\t\\t\\t<p>8.免责声明</p>\\n\\t\\t\\t<p>8.1 您明确理解和同意，塑料圈不对因下述任一情况而发生的任何损害赔偿承担责任，包括但不限于利润、商誉、使用、数据等方面的损失或其他无形损失的损害赔偿 (无论塑料圈是否已被告知该等损害赔偿的可能性)： （1）使用或未能使用“服务”； （2）因通过或从“服务”购买或获取任何货物、样品、数据、资料或服务，或通过或从“服务”接收任何信息或缔结任何交易所产生的获取替代货物和服务的费用； （3） 未经批准接入或更改您的传输资料或数据；任何第三者对“服务”的声明或关于“服务”的行为；或因任何原因而引起的与“服务”有关的任何其他事宜，包括疏忽。</p>\\n\\t\\t\\t<p>8.2 除非另有明确的书面说明,塑料圈不对本站的运营及其包含在本网站上的信息、资料、货物（包括软件）和服务作任何形式的、明示或默示的声明或担保（根据中华人民共和国法律另有规定的以外）。 如因不可抗力或其它本站无法控制的原因使本站销售系统崩溃或无法正常使用导致网上交易无法完成或丢失有关的信息、记录等，塑料圈会合理地尽力协助处理善后事宜。</p>\\n\\t\\t\\t<p>8.3 对于因本公司合理控制范围以外的原因，包括但不限于自然灾害、罢工或骚乱、物质短缺或定量配给、暴动、战争行为、政府行为、通讯或其他设施故障或严重伤亡事故等，致使本公司延迟或未能履约的，塑料圈不对您承担任何责任。</p>\\n\\t\\t\\t<p>9.协议更新及用户关注义务</p>\\n\\t\\t\\t<p>9.1根据国家法律法规变化及网站运营需要，塑料圈有权对本协议条款不时地进行修改，修改后的协议一旦被张贴在本站上即生效，并代替原来的协议。用户可随时登陆查阅最新协议；用户有义务不时关注并阅读最新版的协议及网站公告。如用户不同意更新后的协议，可以且应立即停止接受塑料圈依据本协议提供的服务；如用户继续使用本网站提供的服务的，即视为同意更新后的协议。塑料圈建议您在使用本站之前阅读本协议及本站的公告。 如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余条款的有效性和可执行性。</p>\\n\\t\\t\\t<p>9.2任何经塑料圈确认已经违反相关法律法规或本协议或塑料圈使用规则某一项或多项规定的用户，塑料圈有权决定是否给予暂停使用或终止使用的处理，且因此造成的一切后果由用户自行承担。</p>\\n\\t\\t\\t<p>9.3客户与塑料圈基于交易合作签署的其他书面协议与本协议不一致的，以双方书面签署的协议为准。</p>\\n\\t\\t\\t<p>10.法律及争议解决</p>\\n\\t\\t\\t<p>10.1 本协议受中华人民共和国法律管辖。发生争议时，如对有关业务规则有不同的理解的，以在网站上最新颁布的为准并据之解释。</p>\\n\\t\\t\\t<p>10.2 因履行和解释本协议及相关规则发生的争议，塑料圈与会员、会员与会员须先依友好协商方式解决。如在一方向另一方发出要求协商解决的书面通知之日 15日内争议仍未得到解决，则任何一方均可向塑料圈所在地有管辖权的人民法院提起诉讼。</p>\\n\\t\\t\\t<p>10.3 塑料圈与会员、会员与会员在对争议事项进行协商、和解、调解、诉讼的过程中，应继续履行本协议除争议事项外的其他条款。</p>\\n\\t\\t\\t<p>10.4 如果本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，或违反任何适用的法律，则该条款被视为删除，但本协议的其余条款仍应有效并且有约束力。</p>\\n\\t\\t\\t<p>10.5 塑料圈在法律允许最大范围对本协议拥有解释权与修改权。</p>\\n\\t\\t</div>\\n\\t</div>\\n\\n\";//# sourceMappingURL=data:application/json;charset=utf-8;base64,");

